import Vue from 'vue';
import App from './App.vue';
import router from './router'; // Importa el archivo del router

Vue.config.productionTip = false;

new Vue({
  router,               // Usa el router que definiste en el archivo 'router/index.js'
  render: h => h(App),  // Renderiza el componente principal de la aplicaci贸n
}).$mount('#app');       // Monta la aplicaci贸n en el elemento con id 'app' en tu HTML
